import  React from 'react';
import '../styles/Interests.css';

const Interests: React.FC = () => {
  const interests = [
    { title: "Traveling", description: "Exploring new places, cultures, and cuisines from around the world." },
    { title: "Technology", description: "Keeping up with the latest tech trends and gadgets." },
    { title: "Gaming", description: "Enjoying strategy, adventure, and RPG games in my downtime." },
    { title: "Reading", description: "Diving into books and articles about history, science, and fiction." },
    { title: "Fitness", description: "Staying active with gym sessions, hiking, and outdoor sports." },
  ];

  return (
    <section id="interests" className="interests-section">
      <h2>My Interests</h2>
      <p>Here are some activities and passions I enjoy in my free time.</p>
      <div className="interests-grid">
        {interests.map((interest, index) => (
          <div key={index} className="interest-item">
            <h3 className="interest-title">{interest.title}</h3>
            <p className="interest-description">{interest.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Interests;
